import React, { useState, useEffect } from 'react';

function MyComponent() {
  const [data, setData] = useState({});

  useEffect(() => {
    fetch('/api/data')
      .then((response) => response.json())
      .then((data) => setData(data));
  }, []);

  return (
    <div className='bg-red-100'>
      <p>{data.message}</p>
    </div>
  );
}

export default MyComponent;
